import React from 'react';
import { ThemeProvider, CSSReset } from '@chakra-ui/core';
import Main from './components/Main';

const App = () => {
  return (
    <div style={{ background: 'tomato' }}>
    <ThemeProvider>
      <CSSReset />
      <Main />
    </ThemeProvider>
    </div>
  );
}

export default App;
